import theme from "./theme";
import { Sidebar } from "./Sidebar";

export function Background() {
  return (
    <Grid>
      <Sidebar />
      <Box
        sx={{
          backgroundColor: theme.palette.secondary.light,
          height: "100vh",
        }}
      ></Box>
    </Grid>
  );
}
